// frontend/src/homepage.js
import React, { useState, useEffect } from 'react';
import { Box, Typography, Grid, Button, Card, CardContent, CardMedia } from '@mui/material';

const HomePage = () => {
  const [products, setProducts] = useState([]);

  // Загружаем товары из JSON файла
  useEffect(() => {
    fetch('/products/products.json') // Путь к файлу JSON
      .then((response) => response.json())
      .then((data) => setProducts(data))
      .catch((error) => console.error('Ошибка загрузки товаров:', error));
  }, []);

  const addToCart = (product) => {
    console.log('Добавлен в корзину:', product);
  };

  return (
    <main>
      <Box sx={{ textAlign: 'center', mt: 4 }}>
        <Typography variant="h4" gutterBottom>
          Добро пожаловать в наш книжный магазин
        </Typography>
        <Typography variant="subtitle1" gutterBottom>
          Найдите свою следующую любимую книгу!
        </Typography>

        <Grid container spacing={2} justifyContent="center" sx={{ mt: 2 }}>
          {products.map((product) => (
            <Grid item key={product.id} xs={12} sm={6} md={4}>
              <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                <CardMedia
                  component="img"
                  image={product.image}
                  alt={product.name}
                  sx={{
                    height: 200, // Фиксированная высота для изображения
                    objectFit: 'contain', // Масштабируем изображение без обрезки
                    backgroundColor: '#f5f5f5', // Фон для изображений
                  }}
                />
                <CardContent sx={{ flexGrow: 1 }}>
                  <Typography variant="h6" gutterBottom>
                    {product.name}
                  </Typography>
                  <Typography variant="body2" color="textSecondary">
                    {product.description}
                  </Typography>
                  <Typography variant="h6" color="primary" sx={{ mt: 1 }}>
                    {`Цена: ${product.price} BYN`}
                  </Typography>
                  <Button
                    variant="contained"
                    color="primary"
                    onClick={() => addToCart(product)}
                    sx={{ mt: 2 }}
                  >
                    Добавить в корзину
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </main>
  );
};

export default HomePage;







